import { BrowserRouter as Router, Route } from "react-router-dom";
import Calendar from "./components/CalendarView";
import AddTask from "./components/AddTask";

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <div className="bg-red-50">
          <Calendar month="january" />
          <AddTask />
        </div>
      </Route>
    </Router>
  );
}

export default App;
